const map = L.map('map').setView([25.2048, 55.2708], 7);
L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png').addTo(map);

const sectorLayers = {}, communityLayers = {}, neighbourhoodLayers = {}, landmarkMarkers = [];

geojsonData.features.forEach(f => {
    const props = f.properties;
    const ftype = props.type;
    let name = "";

    if (ftype === "sector") {
        name = props["Sector Name"];
    } else if (ftype === "community") {
        name = `Community: ${props["Community Name"]}<br>${props["Sector Name"] || ""}`;
    } else if (ftype === "neighbour") {
        name = props.name || props.id || props["Neighbourhood Name"];
    } else if (ftype === "landmark") {
        name = props.Name;
    }

    let style = {};

    if (ftype === "sector") {
        style = {
            color: props.strokeColor || "#111",
            weight: 2,
            fillColor: props.fillColor ||"#cccccc",
            fillOpacity: props.fillOpacity ?? 0.1
        };
    } else if (ftype === "community") {
        style = {
            color: props.strokeColor || "#FF0000",
            dashArray: props.strokeDashArray || "15,10",
            weight: 3,
            fillColor: props.fillColor ||"#f5f5f5",
            fillOpacity: props.fillOpacity ?? 0.05
        };
    } else if (ftype === "neighbour") {
        style = {
            color: props.strokeColor || "#111",
            fillColor: props.fillColor || "#F0F",
            weight: 3,
            fillOpacity: props.fillOpacity ?? 0.6
        };
    }

    const layer = L.geoJSON(f, { style }).bindTooltip(name);

    if (ftype === "neighbour") {
        neighbourhoodLayers[name] = layer;
        layer.addTo(map);
    } else if (ftype === "community") {
        communityLayers[props["Community Name"]] = layer;
        layer.addTo(map);
    } else if (ftype === "sector") {
        sectorLayers[props["Sector Name"]] = layer;
        layer.addTo(map);
    } else if (ftype === "landmark") {
        const coords = f.geometry.coordinates;
        const marker = L.circleMarker([coords[1], coords[0]], {
            radius: 6, color: "#E91E63", fillColor: "#FFC107", fillOpacity: 0.85, weight: 1
        }).bindTooltip(`${props.Name} (${props.Description || ""})`);
        marker.feature = f;
        landmarkMarkers.push(marker);
        marker.addTo(map);
    }
});

// --- Dropdown Events ---
document.getElementById("sectorSelect").addEventListener("change", e => {
    const val = e.target.value;
    Object.entries(sectorLayers).forEach(([name, layer]) => {
        if (name === val) {
            map.fitBounds(layer.getBounds());
            layer.setStyle({ weight: 5, color: '#000' });
        } else {
            layer.setStyle({ weight: 2, color: '#ccc' });
        }
    });
});
document.getElementById("neighbourSelect").addEventListener("change", e => {
    const val = e.target.value;
    Object.entries(neighbourhoodLayers).forEach(([name, layer]) => {
        if (name === val) {
            map.fitBounds(layer.getBounds());
            layer.setStyle({ weight: 3, color: '#000' });
        } else {
            layer.setStyle({ weight: 1, color: '#ccc' });
        }
    });
});
document.getElementById("landmarkSelect").addEventListener("change", e => {
    const val = e.target.value;
    landmarkMarkers.forEach(m => {
        const desc = m.feature.properties.Description || "";
        if (!val || val === desc) {
            m.addTo(map);
        } else {
            map.removeLayer(m);
        }
    });
});

// --- Toggle Logic ---
document.getElementById("toggleSector").onchange = e => {
    const show = e.target.checked;
    Object.values(sectorLayers).forEach(l => show ? l.addTo(map) : map.removeLayer(l));
};
document.getElementById("toggleCommunity").onchange = e => {
    const show = e.target.checked;
    Object.values(communityLayers).forEach(l => show ? l.addTo(map) : map.removeLayer(l));
};
document.getElementById("toggleLandmark").onchange = e => {
    const show = e.target.checked;
    landmarkMarkers.forEach(m => show ? m.addTo(map) : map.removeLayer(m));
};

// --- Reset ---
function resetMap() {
    document.getElementById("sectorSelect").value = "";
    document.getElementById("neighbourSelect").value = "";
    document.getElementById("landmarkSelect").value = "";

    Object.values(sectorLayers).forEach(l => l.setStyle({ weight: 3, color: "#888" }).addTo(map));
    Object.values(communityLayers).forEach(l => l.addTo(map));
    Object.values(neighbourhoodLayers).forEach(l => l.setStyle({ weight: 2, color: "#666" }).addTo(map));
    landmarkMarkers.forEach(m => m.addTo(map));

    const bounds = L.featureGroup([
        ...Object.values(neighbourhoodLayers),
        ...Object.values(communityLayers),
        ...Object.values(sectorLayers)
    ]).getBounds();
    map.fitBounds(bounds);
}
</script>
